window.bookSummaryJSON = "<p><b>Not everything you see with your eyes is true, but magic can reveal all that's hidden within.</b></p> <p>Celestia Rainbow and her team of misfits thought they had seen it all. As they enter a new world filled with mystery and suspense, they are uncertain what their future holds at Aslan Academy, School for Hunters and Huntresses.</p> <p>With very little time to recover, they are pushed into a new series of challenges, ones that can either make them stronger or break the bonds they've created.</p> <p>Alliances are made, but evil is still trying to bring Celestia down a darker path. With the clock ticking and the Forsaken multiplying with each passing day, it's up to Finn, Hunter, Orion, Theo, Caio, and Cairus to guide Celestia back to the light in the best way they know how, by loving her with all their might.</p> <p>Will Aslan's badass unicorn be destroyed by the darkness within herself? Or will she be saved by the men who've sworn to protect and care for her? Only one way to find out.</p>"; 
